// @ts-ignore
onmessage = e => {
  console.log('Worker received:', e.data);
  if (process.browser) {
    const a = new Image();
    a.src = e.data;
    console.log(a);
    console.log('I am on browser')
    // @ts-ignore
    // self.postMessage('from Worker');
  } else {
    console.log('I am on server');
  }
};
